Object.Field:
import xml.etree.ElementTree as ET

tree = ET.parse("#FRAMEWORK.V_0553_PATH_REMEDY#FRAMEWORK.V_0553_COD_CONCILIACION.xml")

codigo = 'N'
for elem in tree.getiterator():
    if elem.tag == '#FRAMEWORK.V_0553_TAG_REQ':
        codigo = elem.text
if codigo == 'N':
    raise RuntimeError('No se encontr codigo de respuesta REMEDY')
else:
    f = open("#FRAMEWORK.V_0553_PATH_REMEDY#FRAMEWORK.V_0553_COD_CONCILIACION.txt","w+")
    f.write(codigo)
    f.close()
